import React from 'react';
import { useRoutes } from 'react-router-dom';
import Main from '../../pages/Main';

const RouteList = () => {

    const userRouter = useRoutes([
        {
            path: '*',
            element: <Main /> // notfound 주면됌
        },
        {
            path: '/',
            element: <Main />
        }
    ]);

    return userRouter;
};

export default RouteList;
